		height: '100vh'
		
	}}
	>
	
	<h4>Tongariro Cinemas is the oldest chain of multiplexes in New Zealand. We're committed to showing the best movies in the world.We have 4 theatres in our complex and screen old classics in 2 theatres and new releases in the other 2.</h4>
	<h4>Our address:-13B, Queen;s street, Newtown, Wellington</h4>
	
	<p> Our Contact details -tongariro_c@gmailcom</p>
	<p>Phone numbers-+64 22 314 4223; +64 21 333 7890</p>
	</div>
);
};

export default About;
